import React from "react";
import "./Nav.css";
import NavHeader from "./NavHeader/NavHeader";
import NavFooter from "./NavFooter/NavFooter";

var NavBar = props => {
  return (
    <div style={{ height: "100vh" }}>
      <NavHeader />
      <div className="container mt-3 p-3">{props.children}</div>
      <NavFooter />
    </div>
  );
};

export default NavBar;
